import logo from './logo.svg';
import './App.css';
import {Button} from 'react-native';

function App() {

  // if screen = "homescreen"
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <Button
        title = "test"
      />

    </div>
  );
}

export default App;
